import { Container, Typography } from "@mui/material";
import { Box } from "@mui/system";
import NavBar from "../../myComponents/navbar/Navbar";

export default function CryptoPage() {

  const cryptoData = [
   "Bitcoin",
   "Gitcoin",
   "Litcoin",
   "LaudaCoin",
   "Bitcoin",
   "Gitcoin",
   "Litcoin",
   "LaudaCoin"
  ];

  return (
    <>
    <NavBar/>
    <Container>
      <Typography variant="h6">
        Crypto Coins
      </Typography>
    <Box>
   {
     cryptoData.map
   }
    </Box>
    </Container>
    </>
  )
}
